import React, { useState } from "react";
import { motion,AnimatePresence } from "framer-motion";
import styles from "./ContactMe.module.css";

import{ FontAwesomeIcon} from "@fortawesome/react-fontawesome";
import{} from "@fortawesome/fontawesome-svg-core";
import{} from "@fortawesome/free-regular-svg-icons";
import {faBootstrap, faCss3, faFacebook, faGit, faGithub, faHtml5, faJs, faNodeJs, faReact} from "@fortawesome/free-brands-svg-icons";
const tiempo={
        arriba:{
            y:-50,
            opacity:1
        },
        visible:{
            y:69,
            opacity:1,
            transition:{
                duration:0.1,
                type:"spring",
                damping:200,
                stiffnes:1000
                
            }
        },
        abajo:{
            y:69,opacity:1
         
        }
}
function ContactMe (){
return  ( 
<div>
<motion.div className={styles.box}
    animate={{
      scale: [1, 5, 5, 1, 1],
      rotate: [0, 0, 0, 0, 0],
      borderRadius: ["20%", "10%", "10%", "10%", "10%"],
    }}
    transition={{from:5, duration:3,repeat:1}}> 
    <FontAwesomeIcon className={styles.icono} icon={faHtml5}/>
    <FontAwesomeIcon className={styles.icono} icon={faCss3}/>
    <FontAwesomeIcon className={styles.icono} icon={faJs}/>
    <FontAwesomeIcon className={styles.icono} icon={faReact}/>
    <FontAwesomeIcon className={styles.icono} icon={faBootstrap}/>
    <FontAwesomeIcon className={styles.icono} icon={faGithub}/>
    <FontAwesomeIcon className={styles.icono} icon={faNodeJs}/>
    <FontAwesomeIcon className={styles.icono} icon={faGit}/>
</motion.div>

    

</div>
        );
}
export default ContactMe;
